webpackJsonp([0xd714272b2496],{1079:function(e,s){e.exports={data:{package:{id:"bs-webworkers",score:.5725652003146694,name:"bs-webworkers",version:"0.2.1",description:"Bucklescript bindings for Web Workers",keywords:["webworkers","bucklescript"],license:"MIT",updated:"2018-01-06T10:47:53.893Z",stars:6,type:"published",quality:.7020983704665271,popularity:.03410201322141525,maintenance:.9999999558491885,readme:'<h1>Reason Bindings for the Web Workers API</h1>\n<p>This repository contains bindings for the <a href="https://developer.mozilla.org/en-US/docs/Web/API/Web_Workers_API/">Web Workers API</a>.</p>\n<p>Read more about these <a href="http://davidgom.es/2017/12/23/reasonml-webworkers-bindings.html">here</a>, but keep in mind these bindings have been improved since this article was written.</p>\n<h1>Using this</h1>\n<ol>\n<li>Install the bindings using <code>npm install --save bs-webworkers</code></li>\n<li>Add the bindings to <code>bsconfig.json</code>:</li>\n</ol>\n<pre><code>{\n  "bs-dependencies": [\n      "bs-webworkers"\n  ]\n}\n</code></pre>\n<p>Look in the <code>example/</code> directory for an example of how to use the bindings.</p>\n<h1>Build</h1>\n<pre><code>npm install\nnpm run build\n</code></pre>\n<h1>Tests</h1>\n<pre><code>npm install\nnpm run test\n</code></pre>\n<h1>Demo</h1>\n<pre><code>npm install\nnpm run example\n</code></pre>\n<h1>Todo</h1>\n<p>The full Web Workers API is still not yet implemented (Shared Workers are missing, for instance). PRs are welcome!</p>\n',homepageUrl:"https://github.com/davidgomes/bs-webworkers",repositoryUrl:"https://github.com/davidgomes/bs-webworkers",npmUrl:"https://www.npmjs.com/package/bs-webworkers",issuesUrl:"https://github.com/davidgomes/bs-webworkers/issues",slug:"packages/bs-webworkers"}},pathContext:{id:"bs-webworkers"}}}});
